import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Main from './Main.js';
import sketch from './sketches/sketch';

function App() {
  return (
  	<div>
	    <Main />
	    <P5Wrapper sketch={sketch} color={this.state.color}></P5Wrapper>
    </div>
  );
}

export default App;
